ter(); // ← Nuevo evento\n\n  toggleFavorito(nombre: string) {\n    this.toggleFavoritoClick.emit(nombre); // ← Emitimos el nombre de la receta\n  }\n}\n    \n\n    \n        \n  \n  {{ receta.nombre }}\n\n  \n    \n      \n    \n    \n      \n    \n  \n\n    \n\n    \n                \n                    ./receta-card.component.css\n                \n                \n    \n\n    \n        \n        \n            \n                Legend\n            \n            \n                Html element\n            \n            \n                Component\n            \n            \n                Html element with directive\n            \n        \n    \n\n    \n\n\n\n\n\n\n        var COMPONENT_TEMPLATE = '    {{ receta.nombre }}                                '\n    var COMPONENTS = [{'name': 'AdminComponent', 'selector': 'app-admin'},{'name': 'AppComponent', 'selector': 'app-root'},{'name': 'CategoriaComponent', 'selector': 'app-categoria'},{'name': 'ChefsComponent', 'selector': 'app-chefs'},{'name': 'FavoritesComponent', 'selector': 'app-favorites'},{'name': 'HomeComponent', 'selector': 'app-home'},{'name': 'LoginComponent', 'selector': 'app-login'},{'name': 'NavComponent', 'selector': 'app-nav'},{'name': 'ProfileComponent', 'selector': 'app-profile'},{'name': 'RecetaCardComponent', 'selector': 'app-receta-card'},{'name': 'RegisterComponent', 'selector': 'app-register'},{'name': 'ResetPasswordComponent', 'selector': 'app-reset-password'}];\n    var DIRECTIVES = [];\n    var ACTUAL_COMPONENT = {'name': 'RecetaCardComponent'};\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"injectables/RecetasService.html":{"url":"injectables/RecetasService.html","title":"injectable - RecetasService","body":"\n                   \n\n\n\n\n\n\n\n\n\n  Injectables\n  RecetasService\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/app/services/recetas.service.ts\n        \n\n\n            \n                Description\n            \n            \n                Servicio para gestionar las recetas favoritas de los usuarios.\nSe encarga de obtener, guardar y alternar el estado de favoritos usando localStorage.\n\n            \n\n\n\n            \n    Index\n    \n        \n                \n                    \n                        Properties\n                    \n                \n                \n                    \n                        \n                            \n                                recetasPorCategoria\n                            \n                        \n                    \n                \n\n                \n                    \n                        Methods\n                    \n                \n                \n                    \n                        \n                            \n                                getRecetasPorCategoria\n                            \n                        \n                    \n                \n\n\n\n\n\n        \n    \n\n\n            \n    Constructor\n        \n            \n                \n                    \nconstructor()\n                    \n                \n                        \n                            \n                                Defined in src/app/services/recetas.service.ts:193\n                            \n                        \n\n            \n        \n\n\n            \n    \n    \n        Methods\n    \n    \n        \n            \n                \n                    \n                    \n                        getRecetasPorCategoria\n                        \n                    \n                \n            \n            \n                \ngetRecetasPorCategoria()\n                \n            \n\n\n                    \n                        \n                            Defined in